CharToWchar(const char* ch)
{
	const size_t len = strlen(ch) + 1;
	wchar_t* wch = new wchar_t[len];
	mbstowcs(wch, ch, len);
	return wch;
}


UINT32 ColorToUint32(const no_menu::color color)
{
	UINT32 result =
		(BYTE(color.a) << 24) +
		(BYTE(color.r) << 16) +
		(BYTE(color.g) << 8) +
		BYTE(color.b);
	return result;
}

